    # ml1m
    TRAIN_PATH="/Users/Weilong/Codes/CR_data/ml-1m/train_given10.lsvm"
    VALIDATE_PATH="/Users/Weilong/Codes/CR_data/ml-1m/validate_given10.lsvm"
    TEST_PATH="/Users/Weilong/Codes/CR_data/ml-1m/test_given10.lsvm"
